class Bigtwo156Numpy:
    def __init__(self, state_dict):
        self.weights1 = np.array(state_dict["dense1.weight"]).transpose()
        self.bias1 = np.array(state_dict["dense1.bias"]).transpose()
        self.weights2 = np.array(state_dict["dense2.weight"]).transpose()
        self.bias2 = np.array(state_dict["dense2.bias"]).transpose()
        self.weights3 = np.array(state_dict["dense3.weight"]).transpose()
        self.bias3 = np.array(state_dict["dense3.bias"]).transpose()

    def relu(self, x):
        return np.maximum(0, x)

    def forward(self, x):
        x = np.dot(x, self.weights1) + self.bias1
        x = self.relu(x)
        x = np.dot(x, self.weights2) + self.bias2
        x = self.relu(x)
        x = np.dot(x, self.weights3) + self.bias3
        return x


